import React from 'react'
import { ErrorMessage, Field, Form, withFormik } from 'formik'
import * as Yup from 'yup'
import { API, Auth } from "aws-amplify"
import { withRouter } from "react-router-dom"
import config from "../../../config/constants"
import TimelineCadastro from '../TimelineCadastro';

import './styles.scss'

const ConsoleComponet = (props) => {
    return (
        <>
            <TimelineCadastro current={3} />
            <section className="telaConsole">
                <div className="consoles">
                    <h3 className="titleH3">Insira a Tagname de suas plataformas</h3>
                    <Form className="dadosConsole">
                        <ErrorMessage className="error" component="span" name="pc"/>
                        <fieldset>
                            <Field id="pc" type="text" name="pc"/>
                            <label className="label" htmlFor="pc">Tagname do PC</label>
                        </fieldset>
                        <fieldset>
                            <Field id="playstation" type="text" name="playstation"/>
                            <label className="label" htmlFor="playstation">Tagname do Playstation 4</label>
                        </fieldset>
                        <fieldset>
                            <Field id="xbox" type="text" name="xbox"/>
                            <label className="label" htmlFor="xbox">Tagname do Xbox</label>
                        </fieldset>
                        <button
                            className="continuar"
                            type="submit"
                            style={atv()}
                            disabled={!props.isValid}
                        >Continuar
                        </button>
                    </Form>
                </div>
            </section>
        </>
    )
}

const enhanceWithFormik = withRouter(withFormik({
    mapPropsToValues: () => ({
        pc: '',
        playstation: '',
        xbox: ''
    }),

    validationSchema: Yup.object().shape({
        pc: Yup.string(),
        playstation: Yup.string(),
        xbox: Yup.string(),

    }),
    handleSubmit(values, {props}) {
        console.log('HandlingSubmit. props.history.locatin: ', props.history.location)
        Auth.currentAuthenticatedUser()
            .then(response => {
                console.log("teste: ", response);
                const dados = props.history.location.state.user;
                const options = {
                    body: {
                        user: {
                            name: dados.nome,
                            email: response.attributes.email,
                            date_birth: dados.nascimento,
                            street: dados.rua,
                            street_number: dados.numero,
                            street_complement: dados.complemento,
                            neighborhood: dados.bairro,
                            city: dados.cidade,
                            state: dados.estado,
                            country: "Brasil",
                            postal_code: dados.cep,
                            phone_number: dados.tel,
                            cpf: dados.cpf,
                            nickname: dados.nickname,
                            profile_image: ''
                        },

                        favorites: [],
                        blue_star_balance: 0,
                        points: 0,
                        golden_star_balance: 0,
                        consoles: [
                            {
                                entity_id: "1",
                                name: "PS 4",
                                logo_path: "teste.jpeg",
                                tag_name: "007",
                                games: []
                            },
                            {
                                entity_id: "11",
                                name: "PS 4",
                                logo_path: "teste.jpeg",
                                tag_name: "007",
                                games: []

                            },
                            {
                                entity_id: "12",
                                name: "PS 4",
                                logo_path: "teste.jpeg",
                                tag_name: "007",
                                games: []

                            }
                        ],

                        states_regions: [],
                        countries_regions: [],

                        star_transactions: [],
                    }
                }

                API.post(config.APIS.PLAYERSTARS, '/player', options)
                    .then(response => {
                        console.log(" then : ", response)
                        props.history.push('/termos', options);
                    })
                    .catch(error => {
                        console.log('Esse é o retorno das options', options);
                        console.log('Resultado do response: ', response);
                        console.log('Erro postando dados do usuário: ', error);
                        window.alert('Erro fazendo post dos dados do usuário.');
                    })
            })
            .catch(error => {
                console.log("Erro obtendo usuario atual", error)
            })
    }
})(ConsoleComponet));

export default enhanceWithFormik;
